        [HttpGet("{number}")]
        public async Task<IActionResult> GetUserByNumber(string number,
            [FromHeader] string user_key, [FromHeader] string secret_key, [FromHeader] string timestamp)
        {
            if (!LzStringHelper.VerifyKeysFromHeader(user_key, secret_key))
                return Unauthorized(new ApiResponse<object>(
                    statusCode: StatusCodes.Status401Unauthorized,
                    message: "Invalid user_key or secret_key."));

            var user = await mediator.Send(new GetSingleUserQuery
            {
                Predicate = x => x.IsPatient == true && x.IsEmployee == true &&
                            (x.Legacy != null && x.Legacy.Equals(number) ||
                            x.NIP != null && x.NIP.Equals(number) ||
                            x.Oracle != null && x.Oracle.Equals(number) ||
                            x.SAP != null && x.SAP.Equals(number)),
                Select = x => new User
                {
                    Id = x.Id,
                    Name = x.Name,
                    NoId = x.NoId,
                    JobPosition = new JobPosition
                    {
                        Name = x.JobPosition.Name
                    }
                }
            });

            if (user == null)
            {
                return NotFound(new ApiResponse<object>(
                    statusCode: StatusCodes.Status404NotFound,
                    message: "Number is not found."));
            }

            var ins = (await mediator.Send(new GetInsurancePolicyQuery
            {
                Predicate = x => x.UserId == user.Id && x.Insurance != null && x.Insurance.IsBPJS == true,
                Select = x => new InsurancePolicy
                {
                    PolicyNumber = x.PolicyNumber,
                },
                IsGetAll = true
            })).Item1;

            var userRelations = (await mediator.Send(new GetPatientFamilyRelationQuery
            {
                Predicate = x => x.PatientId == user.Id,
                Select = x => new PatientFamilyRelation
                {
                    FamilyMemberId = x.FamilyMemberId,
                    FamilyMember = new User
                    {
                        Name = x.FamilyMember.Name
                    },
                    Family = new Family
                    {
                        Name = x.Family.Name
                    }
                }
            })).Item1;

            var insRel = (await mediator.Send(new GetInsurancePolicyQuery
            {
                Predicate = x => userRelations.Select(z => z.FamilyMemberId).Contains(x.UserId) && x.Insurance != null && x.Insurance.IsBPJS == true,
                Select = x => new InsurancePolicy
                {
                    UserId = x.UserId,
                    PolicyNumber = x.PolicyNumber,
                },
                IsGetAll = true
            })).Item1;

            // Jika user ditemukan
            //var response = new ApiResponse<object>(
            //    data: new
            //    {
            //        Name = user.NameWithMasked,
            //        Job = user.JobPosition?.Name,
            //        NoId = user.NoId,

            //        InsurancePolicies = ins.Select(x => x.PolicyNumber),
            //        UserRelations = userRelations.Select(x => new
            //        {
            //            FamilyMember = x.FamilyMember.Name,
            //            Relation = x.Family.Name,
            //            InsurancePolicies = insRel.Where(z => z.UserId == x.FamilyMemberId).Select(z => z.PolicyNumber)
            //        }),
            //    });

            //return Ok(response);

            var responseData = new
            {
                Id = user.Id,
                Name = user.NameWithMasked,
                Job = user.JobPosition?.Name,
                NoId = user.NoId,
                InsurancePolicies = ins.Select(x => x.PolicyNumber),
                UserRelations = userRelations.Select(x => new
                {
                    FamilyMemberId = x.FamilyMemberId,
                    FamilyMember = x.FamilyMember.Name,
                    Relation = x.Family.Name,
                    InsurancePolicies = insRel.Where(z => z.UserId == x.FamilyMemberId).Select(z => z.PolicyNumber)
                }),
            };

            // Kompresi dan enkripsi response
            //var encryptedResponse = LzStringHelper.CompressAndEncrypt(responseData, "yourUserKey", "yourSecretKey", a);

            //var decryptedResponse = LzStringHelper.DecompressAndDecrypt(encryptedResponse, "yourUserKey", "yourSecretKey", a);

            return Ok(new ApiResponse<object>(data: LzStringHelper.CompressAndEncrypt(responseData, user_key, secret_key, timestamp)));
        }

        [HttpGet("send-otp/{userId}")]
