        [HttpGet("decrypt-response")]
        public IActionResult Decrypt(string data, [FromHeader] string user_key, [FromHeader] string secret_key, [FromHeader] string timestamp)
        {
            var decryptedResponse = LzStringHelper.DecompressAndDecrypt(data, user_key, secret_key, timestamp);

            return Ok(new ApiResponse<object>(data: System.Text.Json.JsonSerializer.Deserialize<object>(decryptedResponse) ?? "-"));
        }

        private string GenerateOtp()
        {
            // Logika untuk menghasilkan OTP, bisa menggunakan random number atau lainnya
            var random = new Random();
            return random.Next(100000, 999999).ToString();
        }
